using System.Text;

namespace Leetcode5923;

// the new number is 2086


public class Solution
{
    public int MinimumBucketsSingle(string street)
    {
        int result = street.Length;
        Queue<List<int>> q = new Queue<List<int>>();
        q.Enqueue(new List<int> { });
        while (q.Count > 0)
        {
            List<int> buckets = q.Dequeue();
            int start = 0;
            if (buckets.Count > 0)
            {
                start = buckets.Last() + 1;
            }
            bool foundH = false;
            for (int i = start; i < street.Length; i++)
            {
                if (street[i] == 'H')
                {
                    // already have one
                    if (i - 1 >= 0 && buckets.Contains(i - 1))
                    {
                        continue;
                    }

                    bool puts = false;
                    foundH = true;
                    // put b at i-1
                    if (i - 1 >= 0 && street[i - 1] == '.')
                    {
                        var newBuckets = buckets.ToList();
                        newBuckets.Add(i - 1);
                        q.Enqueue(newBuckets);
                        puts = true;
                    }

                    // pub b at i+1
                    if (i + 1 < street.Length && street[i + 1] == '.')
                    {
                        var newBuckets = buckets.ToList();
                        newBuckets.Add(i + 1);
                        q.Enqueue(newBuckets);
                        puts = true;
                    }

                    if (!puts)
                    {
                        return -1;
                    }

                    break;
                }
            }
            if (!foundH)
            {
                result = Math.Min(buckets.Count, result);
            }
        }

        if (result == street.Length)
        {
            return 0;
        }

        return result;
    }

    Dictionary<string, int> memory = new Dictionary<string, int>();

    public int MinimumBuckets(string street)
    {
        string[] subStreets = System.Text.RegularExpressions.Regex.Split(street, @"\.\.\.*");

        if(subStreets.Length == 1)
        {
            return MinimumBucketsSingle(street);
        }

        string first = subStreets[0]+".";
        string last = "."+subStreets[subStreets.Length - 1];
        subStreets = subStreets.Select(s => "."+s+".").ToArray();
        subStreets[0] = first;
        subStreets[subStreets.Length-1] = last;
        int result = 0;
        foreach (string subStreet in subStreets)
        {
            if (memory.ContainsKey(subStreet))
            {
                result += memory[subStreet];
            }
            else
            {
                int buckets = MinimumBucketsSingle(subStreet);
                if (buckets == -1)
                {
                    return -1;
                }
                result += buckets;
                memory[subStreet] = buckets;
            }


        }

        return result;
    }
}

